import React, { useState } from 'react';
import './UserInfoPage.css';
import { useWindowSize } from './useWindowSize';

const UserInfoPage = () => {
  const [formData, setFormData] = useState({
    nickname: '',
    height: '',
    weight: '',
    gender: '',
    purpose: '',
    activity: '',
  });

  const { width } = useWindowSize(); // 화면 너비 가져오기

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = () => {
    const { nickname, height, weight, gender, purpose, activity } = formData;
    if (!nickname || !height || !weight || !gender || !purpose || !activity) {
      alert('정보를 더 입력해 주세요.');
    } else {
      alert('확인 완료!');
    }
  };

  return (
    <div
      className="user-info-container"
      style={{
        maxWidth: width > 768 ? '600px' : '90%', // 화면 크기에 따라 변경
        padding: width > 768 ? '40px' : '20px',
      }}
    >
      <h1>사용자 정보 입력</h1>

      <label>닉네임</label>
      <input
        type="text"
        name="nickname"
        value={formData.nickname}
        onChange={handleInputChange}
        placeholder="닉네임을 입력하세요"
      />

      <label>키 (cm)</label>
      <input
        type="number"
        name="height"
        value={formData.height}
        onChange={handleInputChange}
        placeholder="키를 입력하세요"
      />

      <label>몸무게 (kg)</label>
      <input
        type="number"
        name="weight"
        value={formData.weight}
        onChange={handleInputChange}
        placeholder="몸무게를 입력하세요"
      />

      <label>성별</label>
      <div className="radio-group">
        <label>
          <input
            type="radio"
            name="gender"
            value="남자"
            checked={formData.gender === '남자'}
            onChange={handleInputChange}
          />
          남자
        </label>
        <label>
          <input
            type="radio"
            name="gender"
            value="여자"
            checked={formData.gender === '여자'}
            onChange={handleInputChange}
          />
          여자
        </label>
      </div>

      <label>사용 목적</label>
      <select name="purpose" value={formData.purpose} onChange={handleInputChange}>
        <option value="">목적을 선택하세요</option>
        <option value="다이어트">다이어트</option>
        <option value="체중유지">체중유지</option>
        <option value="벌크업">벌크업</option>
      </select>

      <label>운동량</label>
      <select name="activity" value={formData.activity} onChange={handleInputChange}>
        <option value="">운동량을 선택하세요</option>
        <option value="아주 적음">아주 적음</option>
        <option value="조금 적음">조금 적음</option>
        <option value="보통">보통</option>
        <option value="조금 많음">조금 많음</option>
        <option value="아주 많음">아주 많음</option>
      </select>

      <button onClick={handleSubmit}>등록 완료</button>
    </div>
  );
};

export default UserInfoPage;
